import React from 'react';


function ParkGallery ({ parks }){

  return (
    // const newParkData = parks;
// console.log(newParkData);

    <ul className="cards">

      {parks.map((park) => {
        return (
        <img 
        className = "gallery" 
        alt = {park.images} 
        key = {park.id} 
        src = {park.images[0].url}
        />
        );
      })}
    </ul>
  );
};



